import React from 'react';

const WritePage = () => {
    return (
        <div>
            <h1>글쓰기 페이지</h1>
            <hr/>
            <form>
                <input type="text" placeholder='제목을 입력하세요'/>
                <button type="b"></button>
            </form>
        </div>
    );
};

export default WritePage;
